// src/profile/FrofileImage.js
import React from 'react';
import profileImage from './프로필/앵무새.jpg';

const Frofile = () => {
  return (
    <div>
      <h1>Profile Image</h1>
      <img
        src={profileImage}
        alt="Profile"
        style={{ width: '200px', height: 'auto', borderRadius: '10px' }} // 인라인 스타일 적용
      />
    </div>
  );
};

export default Frofile;
